import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom"
import NavbarPublic from "../layouts/NavbarPublic/NavbarPublic";
import SearchBar from "../components/SearchBar/SearchBar";

function PublicView() {

  const profiles = [
    { value: "2", label: "Flávio" },
    { value: "7", label: "Vinícius" },
    { value: "8", label: "Vanessa" },
  ];

  return (
    <div className="AdminPanel">
      <NavbarPublic/>
      <BrowserRouter>
      <Routes>
        {/* <Route path='/admin/profiles' element={<Profiles/>}></Route>
        <Route path='/admin/create' element={<AddProfileForm/>}></Route> */}
      </Routes>
      </BrowserRouter>
      <h2>Buscar Repo</h2>
      <SearchBar placeholder="Buscar Repo" data={profiles}/>
    </div>
  );
}

export default PublicView;
